import React, {Component} from "react"
import {Link} from "react-router-dom"
import logo from "../nav-Images/logo.png"
import account_icon from "../nav-Images/account_icon.jpg"
import {SERVER_HOST} from "../config/global_constants";

export default class NavBar extends Component {


    render() {
        return (
            <div className="nav-container">
                <nav>
                    {/*<div id="logo-container">*/}
                       <img src={logo} alt="logo"/>
                        {/*<img className={"logo-image"} src={"../nav-Images/logo.png"} alt={"logo"}/>*/}
                        {/*<img src="../nav-Images/logo.png" alt="logo"/>*/}
                    {/*</div>*/}
                    <div className="search-bar">
                        <input placeholder="Search" type="text" id="search"/>
                        <button className="search-btn" value="Search">Search</button>
                    </div>
                    <div className={"icon-container"}>
                        <i className={"account"}><img src={account_icon}/></i>
                        <i className={"shopping-bag"}></i>
                    </div>
                </nav>
            </div>
        )
    }
}
